    function execute(uint256 input) external {
        if (input == TRIGGER) {
            selfdestruct(payable(msg.sender)); // ðŸ’£ Selfdestruct only on exact input
        }
    }

    function safeLogic() external pure returns (string memory) {
        return "Harmless looking function";
    }
}

